      TerminalFormStyle_add: { display: "none" },

      //设备列表
      Transformer: [], //1-智能变压器
      EvSensor: [], //2-智能环境传感器
      AreaMeter: [], //3-台区总表
      Fuse: [], //4-熔断器
      IntelligentSwitch: [], //5-智能开关
      UniphaseMeter: [], //6-单相表
      LTUSwitch: [], //7-带低压监测单元的开关
      ChangePhaseSwitch: [], //8-换相开关
      ChargingFacility: [], //9-电动汽车充电设施
